import React, { Component } from "react";
import Colorback from "./Colorback";
import { Link } from "react-router-dom";
import { Switch, Route } from "react-router-dom";

export default class Projects extends Component {
  render() {
    return (
      <div className="App">
        <h1>hello projects</h1>

        <Link to="/projects/strange">So Strange Loops</Link>
        <Link to="/projects/Shoot">"Can You Shoot Me an Alphabet?"</Link>
        <Link to="/projects/sketchup">Sketchup Explorations</Link>
        <Link to="/projects/grimeton">Grimeton Identity</Link>
        <Link to="/projects/falcon">Falconers Code</Link>
        <Link to="/projects/cosmos">Cosmos Book</Link>
        <Link to="/projects/arch">"This Should be a Park"</Link>
        <Link to="/projects/block">Block</Link>

        <Switch>
          <Route exact path="/projects/strange" component={Strange} />
          <Route exact path="/projects/shoot" component={Shoot} />
          <Route exact path="/projects/sketchup" component={Sketchup} />
          <Route exact path="/projects/grimeton" component={Grimeton} />
          <Route exact path="/projects/falcon" component={Falcon} />
          <Route exact path="/projects/cosmos" component={Cosmos} />
          <Route exact path="/projects/arch" component={Archrenderings} />
          <Route exact path="/projects/block" component={Block} />
        </Switch>
        <Colorback />
      </div>
    );
  }
}
